import homeIcon from './menu_icon.svg'
import proIcon from "./pro_icon.svg";
import videoIcon from "./video_icon.svg"
import shopIcon from "./shop_icon.svg"
export default function MenuBar() {
    const menuList = ['Home','Training','Shopping','Profile','Messenger']
    const menuHome = [homeIcon,videoIcon,shopIcon,proIcon]
    return(
        <div className='menuBar'>   
            {
                menuList.map((menuName, index) =>
                <button>
                    {<img src={menuHome[index]} alt='icon'/>}
                    {menuName}</button>)
            }
        </div>
    )
}
